MongoDB - multiple lookups using .NET driver and LINQ (with grouping and filtering)<p>Given following exemplary MongoDB collection models:</p>
<pre><code>public class House
{
    public int Id { get; set; }
    public string Address { get; set; }
    public double SquareFeet { get; set; }
    public int NumberOfBedrooms { get; set; }
    public int NumberOfKitchens { get; set; }
}

public class Mortgage
{
    public int Id { get; set; }
    public int HouseId {get; set; } // FK 
    public decimal Sum { get; set; }
    public string CurrencyName { get; set; }
}

public class Mortgagee
{
    public int Id { get; set; }
    public int MortgageId { get; set; } // FK
    public string InstitutionName { get; set; }
    public string InstitutionAddress { get; set; }
}

public class Mortgagor
{
    public int Id { get; set; }
    public int MortgageId { get; set; } // FK
    public string Name { get; set; }
    public string Address { get; set; }
}


public class Owner
{
    public int Id { get; set; }
    public int HouseID { get; set; } // FK
    public string FirstName { get; set; }
    public string LastName { get; set; }
}
</code></pre>
<p>I would like to produce following query output:</p>
<pre><code>{
    &quot;House&quot;: {
        &quot;Id&quot;: 123,
        &quot;Address&quot;: &quot;Some city, 1234, Unknown St.&quot;,
        &quot;SquareFeet&quot;: &quot;12345.67&quot;,
        &quot;NumberOfBedrooms&quot;: 4,
        &quot;NumberOfKitchens&quot;: 2,
    },
    &quot;Mortgages&quot;: [
        {
            &quot;Id&quot;: 234,
            &quot;HouseId&quot;: 123,
            &quot;Sum&quot;: 1234.56,
            &quot;CurrencyName&quot;: &quot;USD&quot;,
            &quot;Mortgagee&quot;: {
                &quot;Id&quot;: 345,
                &quot;MortgageId&quot;: 234,
                &quot;InstitutionName&quot;: &quot;Some institution&quot;,
                &quot;InstitutionAddress&quot;: &quot;Some city, 5678, Unknown St.&quot;
            },
            &quot;Mortgagors&quot;: [
                {
                    &quot;Id&quot;: 456,
                    &quot;MortgageId&quot;: 234,
                    &quot;Name&quot;: &quot;John Smith&quot;,
                    &quot;Address&quot;: &quot;Some city, 1234, Unknown St.&quot;
                },
                {
                    &quot;Id&quot;: 567,
                    &quot;MortgageId&quot;: 234,
                    &quot;Name&quot;: &quot;Ann Smith&quot;,
                    &quot;Address&quot;: &quot;Some city, 1234, Unknown St.&quot;
                }
            ]
        }
    ],
    &quot;Owners&quot;: [
        {
            &quot;Id&quot;: 678,
            &quot;HouseId&quot;: 123,
            &quot;FirstName&quot;: &quot;John&quot;,
            &quot;LastName&quot;: &quot;Smith&quot;
        },
        {
            &quot;Id&quot;: 789,
            &quot;HouseId&quot;: 123,
            &quot;FirstName&quot;: &quot;Ann&quot;,
            &quot;LastName&quot;: &quot;Smith&quot;
        }
    ]
}
</code></pre>
<p>I understand that it's possible to use <a href="http://mongodb.github.io/mongo-csharp-driver/2.2/reference/driver/crud/linq/#lookup" rel="nofollow noreferrer">Lookup function</a> to perform join operations, however all examples I can find (both in MongoDB documentation and on SO, blogs etc.) are pretty simple and don't include any <strong>grouping and filtering operations for each lookup</strong> (aggregations) which I would like to do, as real model is more complex.</p>
<p>So essentially what I would like to do is:</p>
<ol>
<li>Create filter for house</li>
<li>Match all houses matching house filter and group them</li>
<li>Lookup all mortgages for house</li>
<li>Filter mortgages and group them</li>
<li>Lookup all mortgagees for all mortgages</li>
<li>Lookup all mortgagors for all mortgages</li>
<li>Lookup all owners for house</li>
<li>Filter owners and group them</li>
<li>...</li>
</ol>
<p>This should happen within one DB call.</p>
<p>What I can do now is:</p>
<pre><code>public class HouseResult: House
{
    public IList&lt;Mortgage&gt; Mortgages { get; set; }
    public IList&lt;Owner&gt; Owners { get; set; }
}

var housesWithMortgagesAndOwners = housesCollection
    .Aggregate()
    .Match(houseFilter)
    .Lookup&lt;House, Mortgage, HouseResult&gt;(
        mortgagesCollection,
        localField =&gt; localField.Id,
        foreignField =&gt; foreignField.HouseId,
        output =&gt; c.Mortgages)
    .Lookup&lt;HouseResult, Owner, HouseResult&gt;(
        ownersCollection,
        localField =&gt; localField.Id,
        foreignField =&gt; foreignField.HouseId,
        c =&gt; c.Owners)
    .ToList();
</code></pre>
<p>However I'm not sure how to proceed with <code>Lookup()</code> for nested arrays (in example above - how to do lookup of all Mortgagees/Mortgagors for every Mortgage. I know that I can <code>Unwind()</code> array, but then structure I was building before will be gone, as I will replace my root with list of mortgages.</p>
<p>Additionally - I'm now sure how I should effectively apply grouping/filtering to <code>Lookup()</code>.</p>
<p>Thanks for all suggestions!</p>

