MongoDB aggregation from nested array of objects<p>I'm working on a school project and I need to join the <em>subject</em> document with <em>content</em> documents on <em>contentId</em>. However, I can't use mongoose because I'm working with a stack provided by the school. Here's an example to explain my problem:</p>
<p>Example <em>subject</em> document:</p>
<pre><code>{
  _id: ObjectId('000000000000000000000100')
  name: &quot;My subject&quot;
  description: &quot;Lorem ipsum...&quot;
  language: &quot;en&quot;,
  topics: [
    {
      id: ObjectId('000000000000000000000200'),
      name: &quot;The first topic&quot;,
      description: &quot;Lorem ipsum...&quot;,
      content: [
        {
          contentId: ObjectId('000000000000000000000300'),
          visibility: true,
        },
        {
          url: &quot;stackoverflow.com&quot;,
          title: &quot;Stack Overflow&quot;,
          type: &quot;website&quot;
        }
      ]
    }
  ]
}
</code></pre>
<p>Example <em>content</em> document:</p>
<pre><code>{
  _id: ObjectId('000000000000000000000300'),
  title: &quot;Example content&quot;,
  description: &quot;Example course in MongoDB&quot;,
  url: &quot;http://example.com/believe/apparatus.php?birthday=bed&amp;boot=bead&quot;
  type: &quot;other&quot;
}
</code></pre>
<p>I need the result of the aggregation to look like this:</p>
<pre><code>{
  _id: ObjectId('000000000000000000000100')
  name: &quot;My subject&quot;
  description: &quot;Lorem ipsum...&quot;
  language: &quot;en&quot;,
  topics: [
    {
      id: ObjectId('000000000000000000000200'),
      name: &quot;The first topic&quot;,
      description: &quot;Lorem ipsum...&quot;,
      content: [
        {
          _id: ObjectId('000000000000000000000300'),
          title: &quot;Example content&quot;,
          description: &quot;Example course in MongoDB&quot;,
          url: &quot;http://example.com/believe/apparatus.php?birthday=bed&amp;boot=bead&quot;
          type: &quot;other&quot;
          visibility: true,
        },
        {
          url: &quot;stackoverflow.com&quot;,
          title: &quot;Stack Overflow&quot;,
          type: &quot;website&quot;
        }
      ]
    }
  ]
}
</code></pre>
<p>I have tried some $unwind and $lookup combinations but none of them returned the correct result.</p>
<p>Is there a way to do this without using mongoose? Thank you.</p>

