Mongoose: Populate or reference Id on Schema?<p>I am wondering which is better in terms of performance.</p>
<p>Let's say i have this Menu Schema</p>
<pre class="lang-js prettyprint-override"><code>{
    restaurant: { type: String, unique: true, required: true },
    color: { type: String, required: true },
}
</code></pre>
<p>And i have this Plate Schema</p>
<pre class="lang-js prettyprint-override"><code>{
    name: { type: String, unique: true, required: true },
}
</code></pre>
<p>If i want to get all the plates from the Menu, which option is better?</p>
<p>Associate the Menu with plates like this:</p>
<pre class="lang-js prettyprint-override"><code>{
        restaurant: { type: String, unique: true, required: true },
        color: { type: String, required: true },
        plates: [
            type: Schema.Types.ObjectId,
            ref: 'plate'
        ]
}
</code></pre>
<p>Or like this:</p>
<pre class="lang-js prettyprint-override"><code>{
        name: { type: String, unique: true, required: true },
        menu: {
            type: Schema.Types.ObjectId,
            ref: 'plate'
        }
}
</code></pre>
<p>With the first option, i would use <code>Menu.findById(id).populate('plates')</code> to get the menu and all the plates associted with it. But with the second option, i would use <code>Plate.find({menu: menu_id})</code></p>
<p>So, which is faster considering that i could have any amount of plates?</p>
<p>And if they are the same, is there a better way of associate Plate and Menu and get plates from Menu?</p>

