MongooseError: Operation `.insertOne()` buffering timed out after 10000ms<p>As a getting-started project with express and MongoDB, I am creating a simple API that will return a joke. For that, I am making a way for users to send a POST request with the joke type and joke in the body which will add the joke to my cluster.</p>
<p>I am using the following Schema:</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');
const schema = mongoose.Schema;

const jokecreateWay = new schema({

    JokeType: {
        type: String,
        //required: true
    },
    joke: {
        type: String,
        //required: true,
    },

})

module.exports = mongoose.model('joke', jokecreateWay)
</code></pre>
<p>with the following post-request code:</p>
<pre><code>app.post('/add-joke', (req, res) =&gt; {
    const joke = req.body;
    const gType = req.body;

    const strigifiedJoke = JSON.stringify(joke);
    const strigifiedGType = JSON.stringify(gType);

    if (joke != null || gType != null) {
        try {

            const toBeInserted = JokeSchema.create({
                JokeType: strigifiedGType,
                joke: strigifiedJoke,
            });

            JokeSchema.save;
            return res.status(201).send({ message: 'joke added' });
        }
        catch (err) {
            return res.status(400).send({ message: err });
        }
    }
    else {
        res.status(418).send({ message: &quot;You forgot to either specify the joke or its type.&quot; })
        return
    }

})
</code></pre>
<p>using insomnia to send the post request I get the following error in the console</p>
<pre><code>D:\api\jokesAPIV2\node_modules\mongoose\lib\drivers\node-mongodb-native\collection.js:158
          const err = new MongooseError(message);
                      ^

MongooseError: Operation `jokes.insertOne()` buffering timed out after 10000ms
    at Timeout.&lt;anonymous&gt; (D:\api\jokesAPIV2\node_modules\mongoose\lib\drivers\node-MongoDB-native\collection.js:158:23)
    at listOnTimeout (node:internal/timers:559:17)
    at processTimers (node:internal/timers:502:7)
</code></pre>
<p>Does anyone know why this happens and how I can fix it?</p>
<p>I have tried mostly everything suggested in <a href="https://stackoverflow.com/questions/65680842/error-mongooseerror-operation-users-insertone-buffering-timed-out-after-1?rq=1">this</a> answer.</p>

