Is it possible to search for keys within an object within a field within a document in mongoDB?<p>I have a form on a page, I want a user to enter something in the form click submit, then make a request to MongoDB using the input of that form and render parts of that request onto a page, using nodejs, mongoose, and ejs</p>
<p>The schema of the collection has a field that always contains an object and I would like to search for a document in the collection that has a key that matches the input of the form.</p>
<p>The schema of the collection is</p>
<pre><code>const ArrivalTimesSchema = new mongoose.Schema({

 postcodeArrivalTimes: {
   type: Object,
   required: true,
  },
 workerId: {
   type: String,
   required: false
  },
 company: {
   type: String,
   required: true    
  },
})
</code></pre>
<p>And an example of postcodeArrivalTimes is</p>
<pre><code>postcodeArrivalTimes = {AL95AT:&quot;07:06&quot;, DL56EP:&quot;13:06&quot;,AL14PL:&quot;19:15&quot;}
</code></pre>
<p>So in this case if someone input AL95AT into the input form I would want this document returned, how would I do that?</p>
<p>Not all documents would contain the key AL95AT but there could be multiple and I would like the last.</p>
<p>For this I think I can use .sort({ $natural: -1 }).limit(1) within a find() but I am not sure how to search for the keys within the object within the field.</p>
<p>Thank you for any help!!</p>

